from sys import stdin
m = [[c for c in line] for line in stdin.read().splitlines()]
p={}

def portals(y, dy1, dy2):
    for x in range(len(m[y])):
        if not m[y][x] in "#. ":
            c = m[y][x] + m[y+dy1][x]
            m[y+dy2][x] = "@"
            if c in p:
                p[c].append((x,y+dy2))
            else:
                p[c] = [(x,y+dy2)]
def portals2(x, dx1, dx2):
    for y in range(len(m)):
        if not m[y][x] in "#. ":
            c = m[y][x] + m[y][x+dx1]
            m[y][x+dx2] = "@"
            if c in p:
                p[c].append((x+dx2,y))
            else:
                p[c] = [(x+dx2,y)]
