#for mm in m: print(''.join(mm))
ml = [[mm[:] for mm in m]]

def teleport(d, l):
    #print(d)
    for pp in p:
        if len(p[pp]) == 1: continue
        if p[pp][0] == d:
            return p[pp][1] + (l-1,)
        elif p[pp][1] == d:
            if l+1 == len(ml): ml.append([mm[:] for mm in m])
            return p[pp][0] + (l+1,)
    return 0,0,-1

def bfs(d, g):
    x,y = d
    s = [(x,y,0,0,[])]
    ml[0][y][x] = "#"
    dd = ((0,-1),(0,1),(-1,0),(1,0))
    while s:
        x,y,l,i,p = s.pop(0)
        #print(i,x,y,l)
        if (x,y) == g and l == 0: return i,p
        if ml[l][y][x] == "@":
            ml[l][y][x] = "#"
            x,y,l = teleport((x,y), l)
            if l >= 0:
                ml[l][y][x] = "#"
                s.append((x, y, l, i+1, p+[(x,y,l)]))
            continue
        for dx,dy in dd:
            mm = ml[l][y+dy][x+dx]
            if mm in '.@':
                if mm == ".": ml[l][y+dy][x+dx] = "#"
                s.append((x+dx, y+dy, l, i+1, p+[(x,y,l)]))
    return i

